import React, { Component } from "react"

class Colours extends Component{
    constructor(){
        this.color1 = "#51413c";
        this.color2 = "#f5834d";
        this.color3 = "#ffcc63";
        this.color4 = "#f8f6ec";
        this.color5 = "#779e66";
    }

}

export default Colours;
